import React, { Component } from 'react';
import Social from './Social';
import StrapiAuth from './auth/StrapiAuth';

class App extends Component {
  constructor(props) {
    super(props);

    this.state = {
      user: undefined,
      jwt: undefined,
      loggedIn: false
    }
  }

  UpdateUser = (user, jwt) => {
    this.setState({
      user: user,
      jwt: jwt
    })
  }

  render() {
    return (
      <div>

        <h1>DUBZOO</h1>
        <StrapiAuth />

        <ul className="socials">
          <li><Social target="YouTube"/></li>
        </ul>

      </div>
    );
  }
}

export default App;
